import { Component } from 'react'
import Nav from './Components/Nav'
import HomePageMain from './Components/Main'

class HomePage extends Component{
    constructor(props){
        super(props);
        this.state = {
            session: 'hello',
        }
    }

    async componentDidMount(){
        const fetchingUser = await fetch('http://127.0.0.1:8080/auth');
        const data = await fetchingUser.text();
        await this.setState({session: data});
        await console.log(this.state.session);
    }

    render(){
        return(
            <> 
                <Nav />
                <HomePageMain />
            </>
        )
    }
}

export default HomePage
